import React from 'react';
import styled from 'styled-components';
import Plx from 'react-plx';

import SlideOne from './slides/SlideOne';
import SlideTwo from './slides/SlideTwo';
import SlideThree from './slides/SlideThree';
import SlideFour from './slides/SlideFour';
import SlideFive from './slides/SlideFive';
import SlideSix from './slides/SlideSix';

const StyledApp = styled.div`
  background: #FFFFFF;

  .sticky-trigger-1 {
    margin-top: 98vh;
  }
  .sticky-slide-2 {
    position: fixed;
    bottom: 0;
    opacity: 0;
  }
`;

function App() {

  const slideTwoPlx = [
    {
      start: '.sticky-trigger-1',
      duration: '1',
      properties: [
        {
          startValue: 0,
          endValue: 1,
          property: 'opacity',
        },
      ],
    },
    {
      start: '.sticky-trigger-1',
      duration: '10vh',
      properties: [
        {
          startValue: 0,
          endValue: -25,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
    {
      start: '.sticky-trigger-1',
      startOffset: '10vh',
      duration: '10vh',
      properties: [
        {
          startValue: -25,
          endValue: -10,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
    {
      start: '.sticky-trigger-1',
      startOffset: '60vh',
      duration: '100vh',
      properties: [
        {
          startValue: 0,
          endValue: -100,
          unit: 'vh',
          property: 'translateY',
        },
      ],
    },
  ];

  return (
    <StyledApp className="App">
      <SlideOne />
      <div className='sticky-trigger-1' />
      <Plx
        className='sticky-slide-2'
        parallaxData={slideTwoPlx}
      >
        <SlideTwo />
      </Plx>
      <SlideThree />
      <div className='sticky-trigger-2' />
      <SlideFour />
      <div className='sticky-trigger-3' />
      <SlideFive />
      <div className='sticky-trigger-4' />
      <SlideSix />
      <div className='sticky-trigger-5' />
    </StyledApp>
  );
}

export default App;
